import React from "react";
import { useEffect, useState } from "react";
import { vendiaClient } from "./VendiaClient";
import Box from '@mui/material/Box';
import { DataGrid, GridColDef, GridValueGetterParams } from '@mui/x-data-grid';

const { client } = vendiaClient();

const columns: GridColDef[] = [
    { field: 'TestID', headerName: 'TestID', width: 150 },
    { field: 'OrgAssignment', headerName: 'OrgAssignment', width: 150 },
    { field: 'TestName', headerName: 'TestName', width: 150 },
    { field: 'TestMethod', headerName: 'TestMethod', width: 150 },
    { field: 'Notes', headerName: 'Notes', width: 150 },
    { field: 'Completed', headerName: 'Completed', width: 150 },
    { field: 'UpdatedBy', headerName: 'UpdatedBy', width: 150 },
  ];

export const DevicePage = () => {


    return(
        
        <div className="DevicePage">
            <div style={{ height: 300, width: '100%' }}>
                <DataGrid rows={rows} columns={columns} />
            </div>
        </div>

    )
}
